aspard et Balthazar<br/>C''est quoi ?<br/><br/>Si t''es dans une bagarre,<br/>Compte sur nous<br/>On débarque en side-car<br/>Avec nos nunchakus<br/><br/>Mec t''as compris<br/>Avec nous c''est easy<br/>Un peu comme Gaspard <br/>Quand il montre son ...<br/><br/>Oh mais oh ! Ça l''fait exprès ou quoi ! Pourquoi à chaque<br/>fois qu''on fait des rimes ça fait genre euh... Bon aller !<br/><br/>On pourra faire des foots<br/>Et marquer des buts<br/>S''balader en forêt<br/>Et s''taper des ... Ohh !<br/><br/>Si t''as b''soin d''argent<br/>Demande-nous on pèse<br/>Plus t''es riche,<br/>Plus tu ... Bah nan !<br/><br/>On f''ra des piques-niques<br/>Rillettes et cornichons<br/>On pourra s''allonger<br/>Et toucher tes ... NICHONS !<br/><br/>On pourra bricoler<br/>Et installer ta hotte<br/>Repasser tes affaires<br/>Et sentir tes cu... Oh la la !<br/><br/>Répondez-nous vite<br/>N''aillez pas la trouille<br/>On est toujours tout seuls<br/>ET ça nous casse les COUILLES !<br/><br/>Oh pétard ! Raté !<br/>Mais appelez-nous quand même hein, on est des gentils<br/>garçons et puis en plus c''est un super programme<br/><br/>C''était Gaspard et Balthazar<br/>C''était Gaspard et Balthazar<br/>C''était Gaspard et Balthazar<br/>C''était Gaspard et Balthazar<br/><br/>Hip hop !<br/>Yeah, nigger'),
