(54, 'Ça m''vénère', 'https://dl.dropboxusercontent.com/s/375ohn80mlbfnuu/ca-mvenere-palmashow.mp3', 12, 11, 'ttps://www.youtube.com/watch?v=AfiINIrFMRM', '2016-04-29 16:10:16', '[Maské]<br/>Han, Maské et Maître Grims (hou yeah)<br/>De retour parce qu''on revient<br/>Et ainsi de suite (ho ho)<br/>Y a trop de trucs qui m''énervent sur Terre<br/>Les chômeurs sans travail, les orphelins sans père<br/>Plus rien ne tourne rond et personne veut l''admettre<br/>Et ça m''vénère, dit leur Maître<br/><br/>[Maître Grims]<br/>Ça m''vénère !<br/>Quand je marche en chaussettes dans la salle de bains<br/>Et qu''y a de l''eau partout j''fais ça tout les matins<br/>Je tire mal mon rideau qu''y a des motifs indiens<br/>Oh ça m''vénère, oui ça m''vénère !<br/><br/>[Maské]<br/>Okay D’accord, j’te comprends mais j’pensais pas à<br/>ça<br/>Plus aux problèmes de la jeunesse tu vois les trucs comme<br/>ça<br/>Tous les échecs scolaires, les familles déchirées<br/>Ça m’vénère, dis leur maître, j’peux plus respirer<br/>!<br/><br/>[Maître Grims]<br/>Ça m’vénère !<br/>Quand je me cogne le doigt de pied sur le coin du lit<br/>Quand je commande un cheese cake et qu’y’a pas<br/>d’coulis<br/>Quand je repasse mes t-shirts et que je fais des plis<br/>Oh ça m’vénère, oui ça m’vénère !<br/><br/>[Maské]<br/>T’as raison, mais une fois de plus, mais c’est pas<br/>c’que j’voulais dire<br/>Genre les SDF sans toit qui n’savent pas où dormir<br/>Ces jeunes qui vendent de la drogue et qui deviennent<br/>dealer<br/>Allez frère, j’compte sur toi, cette fois çi dis-leur<br/><br/>[Maître Grims]<br/>Ça m’vénère !<br/>Quand j’conduis et qu’un voyant que j’connais pas<br/>s’allume<br/>Quand Evelyne Dheliat dis que d’main y’a d’la brume<br/>Quand je souffle les bougies magiques et qu’elle<br/>s’rallument<br/>Oh ça m’vénère, oui ça m’vénère !<br/>Quand mes écouteurs sont tout emmêlés<br/>Quand j’ai un kinder et j’sais pas construire le jouet<br/>Quand il fait chaud et que mes lunettes sont pleines de<br/>buée<br/>Oh ça m’vénère, oui ça m’vénère !<br/><br/>[Maské]<br/>Écoute Grims, j’suis d’accord mais j’vais recentrer<br/>un peu<br/>J’vais parler des galères des grands et des tits-pe, et<br/>tous ces…<br/><br/>[Maître Grims]<br/>Ça m’vénère !<br/>Quand j’ai du scotch j’trouve pas l’bout du rouleau<br/>Quand quelqu’un range une bouteille vide dans le frigo<br/>Quand j’vais a Disney et que j’vois pas Dingo<br/>Oh ça m’vénère, oui ça m’vénère !<br/>Quand j’fais des mots fléchés et qu’un mot rentre pas<br/>Quand j’entends le refrain de la chanson Bella<br/>Ah oui mais nan c’est vrai que cette chanson c’est moi<br/>Oh j’me vénère, j’crois qu’je m’vénère !<br/><br/>[Maské]<br/>Y’a beaucoup de trucs qui te vénèrent Grims<br/><br/>[Maître Grims]<br/>Ouais j’suis vénère, super vénère !<br/><br/>[Maské]<br/>J’vois ça… puis tu chantes fort…'),
(55, 'Quinoa', 'https://dl.dropboxusercontent.com/s/iyvf9kgza54xac0/quinoa.mp3', 12, 12, 'https://www.youtube.com/watch?v=wYFQJSrIo88', '2016-04-29 16:22:41', 'Ce monde est rempli de haine<br/>Il y a des gens qui mangent encore du gluten<br/>Ce monde est sans foi ni loi<br/>Les restos jap'' sont souvent tenus par les chinois<br/>Ce monde nous fait peur<br/>Je dis ça, je dis rien<br/>Des gens mettent : #nofilter<br/>Il y a un filter<br/>Ce monde ne pense qu''à la thune,<br/>C''est dit dans notre nouvel album, dispo sur Itunes<br/><br/>[Refrain]<br/>Je dis ça, je dis rien<br/>On a des problèmes<br/>GoPro qui se coupe trop tôt<br/>Les fautes d''ortho'' sur le macchiato<br/>Je dis ça, je dis rien<br/>Mais je le dis quand même<br/>Les brunchs sans quinoa<br/>Quinoa<br/><br/>[Interlude]<br/>Tu sais je suis Christine, de Christine and The Queens<br/>Je m''appelle pas vraiment Christine, mais je suis quand<br/>même la Queen<br/>Je peux danser, chanter, chuchoter, je sais même respirer<br/>T''as vu c''est joli, petite maison dans la prairie<br/>C''est moi la première, nananananère<br/><br/>[Refrain]<br/><br/>On a des problèmes<br/>Plus de freins sur mon Fixie<br/>Airbnb sans wifi<br/>On dit ça, on dit rien<br/>Mais on le dit quand même<br/>Nous vous pointons du doigt<br/>A qui de droit'),
