(57, 'Rap des prénoms', 'https://dl.dropboxusercontent.com/s/3aiqfuxqj14wmad/rap_prenoms.mp3', 12, 15, 'https://www.youtube.com/watch?v=M1MizPjr8AY', '2016-04-29 22:35:58', 'Ouais dans la vie y''a des prénoms prédestinés<br/>C''est vrai dans certains cas dont l''avenir est tout<br/>dessiné<br/>T''as vu les Jackie regarde comment on les taille<br/>Banane, jogging, plus besoin d''détails<br/>Mickaël et Kévin c''est les kékés du fond d''la classe<br/>Ils aiment le tunning et font du wheeling sur la place<br/>Jimmy c''est un gitan toujours accusé à tort<br/>Tous les Joël sont gays mais ils le savent pas encore<br/>T''as vu les Olivier c''est des putains d''monos de ski<br/>Et ouais ils sont sympas c''est comme les Frédo et Thierry<br/>Et Corinne 35 ans célibataire endurcie<br/>S''inscrit tous les dimanches pour la vitrine du juste prix<br/>Eric, Bruno, Dédi, des sapeurs pompiers<br/>Coupe en brosse, polo Brice et des N au pied<br/>Hubert c''est l''dirlo d''colo, Hervé un bon bricolo<br/>Et Gérard c''est un bon nom d''alcolo <br/><br/>Et yo tu connais forcément quelqu''un dans l''tas<br/>Collé sur tes potes, sur ta meuf ou sur ton papa<br/>C''est les prénoms par le palmashow<br/>C''est les prénoms<br/><br/>C''est Casto c''est Francki qui pousse les palettes<br/>Et sur ta caisse c''est Dédé qui refait les plaquettes<br/>Patrice et Fabrice sont managers chez Mondial Moquette<br/>Dider fat des barbeuc'' et les meilleures brochettes<br/>Manu, Luc et Seb jouent tous d''un instrument<br/>Pour péter Oasis et Radohead autour du feu d''camp<br/>Et Pierrick et Loïc bah ils sont repartis en mer<br/>Comme tous les mecs en -ik <br/>Partis faire le tour du monde en solitaire<br/>Au supermarché c''est toujours les mêmes blaz''<br/>Sylvie, Martine, Annie j''en peux plus ça m''blase<br/>Sandrine est responsable du rayon PQ molletonné <br/>Et Capucine t''as un prénom de poney<br/>Lucas a un nom d''apache et chez Paul y''a des sandwichs<br/>Fred et Marlote rêvent de jouer dans Sun set beach<br/>Francis a une moustache, et Gillou s''fait pousser l''bouc<br/>En boîte Pascal fait tâche et met ses Raybans sur<br/>facebook<br/><br/>Et yo tu connais forcément quelqu''un dans l''tas<br/>Collé sur tes potes, sur ta meuf ou sur ton papa<br/>C''est les prénoms par le palmashow<br/>C''est les prénoms<br/><br/>Natacha c''est une coquine <br/>Alors que Murielle rentre pas dans son slim<br/>Marie-Pierre ta banquière et Robert gras du bide<br/>Les Cindy sont stagiaires chez Jean-Louis David<br/>Les bonnes c''est toutes les mêmes <br/>Toutes celle qui s''appellent Sarah<br/>Le truc c''est qu''elles s''la donnent <br/>Comme les meufs qui bossent chez Zara<br/>Mike, John et Steeve ttaffent chez Diesel <br/>Ryan un peu racailleux, eh mademoiselle<br/>Florent est comédien est décroche les rôles pour Mehen<br/>Mylène c''est la relou qu''on a bloqué sur MSN<br/>Et Marjolène et Jeanne passent le concours d''instit<br/>José a un synthé et Booba qu''a une grosse ****<br/><br/>A toi l''honneur mon pote d''leur annoncer les champions<br/>La crème des crème du pire de tout c''qui s''fait en<br/>prénom<br/>Rockstar du calendar c''est des mecs exceptionnels<br/>On s''devait d''finir sur Denis, Serge et Lionel<br/><br/>C''est les prénoms par le palmashow<br/>C''est les prénoms par le palmashow<br/>C''est les prénoms par le palmashow<br/>C''est les prénoms<br/><br/>C''est les prénoms par le palmashow<br/>C''est les prénoms<br/>C''est les prénoms par le palmashow<br/>C''est les prénoms'),
(58, 'Monos de ski', 'https://dl.dropboxusercontent.com/s/k9tyh0mbl1nxc13/monos_ski.mp3', 12, 14, 'https://www.youtube.com/watch?v=QmfdN_nj5wo', '2016-04-29 22:40:03', 'Hey! Tu sais c''est qui<br/>Les monos de ski<br/>On a la belle vie<br/>C''est nous les monos de ski<br/>Hey! Tu sais c''est qui<br/>Les monos de ski<br/>On tient pas la perche sur l''téléski<br/>Les monos de ski!<br/><br/>JP et Denis, on est monos de ski<br/>On tient pas la perche sur le téléski<br/>Bronzage optimum, on a nos combis ouvertes<br/>On godille partout, même sur les pistes vertes<br/>Check nos potes au bar, et on claque des bises au Spar<br/>Ici c''est nous les stars, mate nos Dynastar<br/>Alors besoin d''un conseil? Demande aux boss de la station<br/>On connaît toutes les gonzesses, et les bons plans<br/>saucisson<br/><br/>Hey! Tu sais c''est qui<br/>Les monos de ski<br/>On a la belle vie<br/>C''est nous les monos de ski<br/>Hey! Tu sais c''est qui<br/>Les monos de ski<br/>On tient pas la perche sur l''téléski<br/>Les monos de ski!<br/><br/>Torse-nu en terrasse, Labello sur les crevasses<br/>Jamais écrevisse: on s''met du monoï en masse<br/>P''tit verre de vin chaud sous le soleil de Méribel<br/>P''tites pompes claquées qui impressionnent les demoiselles<br/>Les yeux fermés on chausse devant le resto d''altitude<br/>T''as peur de la poudreuse? T''inquiète pas, on a l''habitude<br/>"La Castor", "la Marmotte", "l''Aiguillette" et "la Trappeur"<br/>Les pistes de ski, on les connaît par cœur<br/>Tu veux un cours particulier? Viens passer ton chamois<br/>Mets ton môme chez les Piou-Piou, qu''on soit juste toi z''et<br/>moi<br/>Écarte bien les jambes, les skis parallèles<br/>Cambre-toi mon ange, et j''te ferai pousser des ailes<br/>Sur le télésiège on fera plus ample connaissance<br/>Prends nos cours du soir pour réveiller tes sens<br/>Raclette aux chandelles, bolée de champagne<br/>Dans notre huit mètres-carrés, avec vue sur la montagne<br/><br/>Hey! Tu sais c''est qui<br/>Les monos de ski<br/>On a la belle vie<br/>C''est nous les monos de ski<br/>Hey! Tu sais c''est qui<br/>Les monos de ski<br/>On tient pas la perche sur l''téléski<br/>Les monos de ski!<br/><br/>Libres comme l''air, c''est les vacances toute l''année<br/>Juste après l''hiver, c''est l''Club Méditerranée<br/>Vos mecs sont jaloux: ils n''ont pas ce loisir<br/>Avec nos bâtons, on sait donner du plaisir<br/>Alors viens dans notre cours toute la semaine<br/>On t''fera découvrir les secrets du domaine<br/>C''est vrai qu''on est dragueurs, et qu''on tchatche, mais pas<br/>que<br/>On a aussi le forfait pour griller la queue<br/><br/>Hey! Tu sais c''est qui<br/>Les monos de ski<br/>On a la belle vie<br/>C''est nous les monos de ski<br/>Hey! Tu sais c''est qui<br/>Les monos de ski<br/>On tient pas la perche sur l''téléski<br/>Les monos de ski!'),
