(62, 'Under Seventeen', 'https://dl.dropboxusercontent.com/s/3q8e41ka9vzpzdw/under_seventeen.mp3', 12, 16, 'https://www.youtube.com/watch?v=ppUYiVdf--g', '2016-05-01 12:28:01', 'Samedi soir, boîte de nuit<br/>            Le Snoopyz , on buvait<br/>            Tous les deux un Gin Fizz<br/>            On te regardait danser sur la piste<br/>            Dans nos têtes<br/>            Envie de faire des bêtises<br/>            Regard sensuel<br/>            rêve de plaisir charnel<br/><br/>            Tâtons la marchandise<br/>            mais question essentielle<br/>            et pour le septième ciel<br/>            il faut que tu sois précise<br/>            - Quel âge a-tu?<br/>            - Vingt ans.<br/>            - Oh! Trop vielle<br/><br/>            [Refrain]<br/>            En dessous de seventeen<br/>            nous c''est en dessous de seventeen<br/>            Be in my sweet sixteen<br/>            You know what I mean<br/><br/>            On est des grands chanteurs<br/>            on mérite le meilleur<br/>            On préfère la fraicheur<br/>            under seventeen<br/>            Parce que les filles majeures<br/>            disent qu''on est des branleurs<br/>            - En gros<br/>            They are not interested in<br/><br/><br/>            [Refrain]<br/><br/>            Tu peux être câline<br/>            tu peux être féline<br/>            mais notre doctrine<br/>            C''est en dessous de seventeen<br/>            Tu peux être ma cousine<br/>            ou être bouledogue d''argentine<br/>            nous en est in<br/>            si t''est under seventeen! (teen, teen, teen, teen, teen,<br/>            teen, teen)'),
